export const clipsAction = (check)=>{
    return(dispatch)=>{
        dispatch({
            type: "powerOn",
            payload:check
        })
    }
}

export const powerOffAction = (check)=>{
    return (dispatch)=>{
        dispatch({
            type:'powerOff',
            payload: check
        })
    }
}
